import React from 'react';

export default class Profile extends React.Component{

  state = {profiles:[]}

  componentDidMount(){
    const data = [{name:'StudentMentor1',rollNo:'16BECXXX',attendance:'100',batch:'2017-2021',academicDetails:'None',imgUrl:'data:image/jpeg;base64,'},{name:'StudentMentor1',rollNo:'16BECXXX',attendance:'100',batch:'2017-2021',academicDetails:'None',imgUrl:'data:image/jpeg;base64,'},{name:'StudentMentor1',rollNo:'16BECXXX',attendance:'100',batch:'2017-2021',academicDetails:'None',imgUrl:'data:image/jpeg;base64,'},{name:'StudentMentor1',rollNo:'16BECXXX',attendance:'100',batch:'2017-2021',academicDetails:'None',imgUrl:'data:image/jpeg;base64,'},{name:'StudentMentor1',rollNo:'16BECXXX',attendance:'100',batch:'2017-2021',academicDetails:'None',imgUrl:'data:image/jpeg;base64,'}]
    this.setState({profiles:data})
  }

  render(){

    return(
  <div style={profileContainerStyle}>
    <div style={{marginBottom:'100px'}}>
    <center>
      <h1>Mentee Profiles</h1>
    </center>
    </div>
    {this.state.profiles.map((profile) => {
      return(
        <div style={{justifyContent:"space-around",flexDirection:"row",display:'flex',border:'1px solid gray',padding:'20px',margin:'10px',borderRadius:'5px'}}>
        <div>
        <img src={profile.imgUrl} alt="No image" style={profileImageStyle}/>
        </div>
        <div>
        <p><b>Name:</b>{profile.name}</p>
        <p><b>RollNo:</b>{profile.rollNo}</p>
        <p><b>Batch:</b>{profile.batch}</p>
        <p><b>Attendance:</b>{profile.attendance}</p>
        <p><b>Academic Details:</b>{profile.academicDetails}</p>
        </div>
        </div>
      );
    })}}
  </div>
);
}
}

const profileContainerStyle = {

    fontFamily:"Helvetica",
    fontSize: '20px',
}

const profileImageStyle = {
  height:"250px",
  width:"250px",
  borderRadius:"50%"
}
